import Vue from 'vue'
Vue.component("MContent", () => import("/Users/elliehamilton/Developer/portfolio/docs/.vuepress/components/MContent.vue"))
Vue.component("Projects", () => import("/Users/elliehamilton/Developer/portfolio/docs/.vuepress/components/Projects.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-4ec3b60dfd89f",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/elliehamilton/Developer/portfolio/docs/README.md").then(comp => {
        Vue.component("v-4ec3b60dfd89f", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-f7c3ecc507da9",
    path: "/projects.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/elliehamilton/Developer/portfolio/docs/projects.md").then(comp => {
        Vue.component("v-f7c3ecc507da9", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
